function trim(stringToTrim) {
  stringToTrim = stringToTrim + '';
  return stringToTrim.replace(/^\s+|\s+$/g,"");
}
function ltrim(stringToTrim) {
  stringToTrim = stringToTrim + '';
  return stringToTrim.replace(/^\s+/,"");
}
function rtrim(stringToTrim) {
  stringToTrim = stringToTrim + '';
  return stringToTrim.replace(/\s+$/,"");
}
function chr(ascii) {  
  return String.fromCharCode(ascii);  
}  


//Armazena o menu da vez...
var mapMenu = {};

//Zera o menu
function zeraMenu() {
  mapMenu.frases = '';
  mapMenu.mascara = 0;
  mapMenu.log = '';
}

//Inclui uma opcao no menu (frase e número da opção)
function incluiOpcaoMenu(opcao, frase) {
  if (trim(frase) != '') {
    if (mapMenu.frases != '') {
      mapMenu.frases += ';';
    }
    mapMenu.frases += frase;
  }
  if (opcao >= 0) {
    mapMenu.mascara += (1 << opcao);
    mapMenu.log += opcao + ' ';
  }
}

//Retorna o tipo de discagem no menu
function tipoRetornoMenu(opcao) {
  if (opcao == '!') return 'MENU_TIMEOUT';
  if (mapMenu.mascara & (1 << opcao)) 
    return 'MENU_OPCAO_OK';
  else 
    return 'MENU_OPCAO_NOK';
}
//Retorna true <=> o mapa parâmetro está vazio
function mapaVazio(map) {
  for(var key in map) {
    return false;
  }
  return true;
}

function validaCentral() {
  resp = 'OK';
  if (aplProduto == 'ProjetosEspeciais') {
    if (typeof(aplListaCartaoAtivo[aplIndCartao].giftCard.channelId) != 'undefined') {
      logger.info('channelid:' + aplListaCartaoAtivo[aplIndCartao].giftCard.channelId);
      if (PROJETOSESPECIAIS_CHANNELID.indexOf('#' + aplListaCartaoAtivo[aplIndCartao].giftCard.channelId + '#') < 0) {
        resp = 'INVALIDO';
      }
    } else {
      resp = 'INVALIDO';
    }
  } else if (aplProduto == 'Governo') {
    ehValido = false;
    if (typeof(aplListaCartaoAtivo[aplIndCartao].giftCard.channelId) != 'undefined') {
      logger.info('channelid:' + aplListaCartaoAtivo[aplIndCartao].giftCard.channelId);
      if (GOVERNO_CHANNELID.indexOf('#' + aplListaCartaoAtivo[aplIndCartao].giftCard.channelId + '#') >= 0) {
        ehValido = true;
      }
    }
    if ((!ehValido) && (typeof(aplListaCartaoAtivo[aplIndCartao].giftCard.modality) != 'undefined')) {
      logger.info('modality:' + aplListaCartaoAtivo[aplIndCartao].giftCard.modality.id);
      if (GOVERNO_MODALITY.indexOf('#' + aplListaCartaoAtivo[aplIndCartao].giftCard.modality.id + '#') >= 0) {
        ehValido = true;
      }
    } 
    if (!ehValido) {
      resp = 'INVALIDO';
    }
  } else {   //vale
    //se for vale, o cartão só é válido se não entrar nas condicoes de cartao Projetos Especiais e Governo
    ehValido = true;
    if (typeof(aplListaCartaoAtivo[aplIndCartao].giftCard.channelId) != 'undefined') {
      logger.info('channelid:' + aplListaCartaoAtivo[aplIndCartao].giftCard.channelId);
      if ((PROJETOSESPECIAIS_CHANNELID.indexOf('#' + aplListaCartaoAtivo[aplIndCartao].giftCard.channelId + '#') >= 0) || ((GOVERNO_CHANNELID.indexOf('#' + aplListaCartaoAtivo[aplIndCartao].giftCard.channelId + '#') >= 0))){
        ehValido = false;
      } else {
        //valida se é 99 taxi
        if ((aplListaCartaoAtivo[aplIndCartao].giftCard.channelId == '4740') || (aplListaCartaoAtivo[aplIndCartao].giftCard.channelId == '6474') || (aplListaCartaoAtivo[aplIndCartao].giftCard.channelId == 4740) || (aplListaCartaoAtivo[aplIndCartao].giftCard.channelId == 6474)) {
          apl99Taxi = true;
          ehValido = false;
          aplEventoConsulta = 'C_ATENDIDAS_99TAXI';
        }
      }
    }
    if ((ehValido) && (typeof(aplListaCartaoAtivo[aplIndCartao].giftCard.modality) != 'undefined')) {
      logger.info('modality:' + aplListaCartaoAtivo[aplIndCartao].giftCard.modality.id);
      if (GOVERNO_MODALITY.indexOf('#' + aplListaCartaoAtivo[aplIndCartao].giftCard.modality.id + '#') >= 0) {
        ehValido = false;
      }
    }
    logger.info('salesType:' + aplListaCartaoAtivo[aplIndCartao].giftCard.salesType);
    if (apl99Taxi) {
      resp = 'OK';
      aplEventoConsulta = 'C_ATENDIDAS_99TAXI';
    } else if (!ehValido) {
      resp = 'INVALIDO';
    } else if (typeof(aplListaCartaoAtivo[aplIndCartao].giftCard.salesType) != 'undefined') {
      //somente para verificar se é walmart
      if (VALE_TIPOVENDA.indexOf('#' + aplListaCartaoAtivo[aplIndCartao].giftCard.salesType + '#') >= 0) {
        aplWalmart = true;
      }
    }
  }
  return resp;
}

function devolveFilaTransf() {
  if (aplProduto == 'ProjetosEspeciais') {
    resp = FILA_PROJETOSESPECIAIS;
  } else if (aplProduto == 'BNDES') {
    resp = FILA_BNDES;
  } else if (aplProduto == 'Governo') {
    resp = FILA_GOVERNO;
    ehValido = false;
    logger.info('GOVERNO_CHANNELID aplTotalAtivo:' + aplTotalAtivo);
    logger.info('aplIndCartao:' + aplIndCartao);
    if (aplTotalAtivo > 0) {
      if (typeof(aplListaCartaoAtivo[aplIndCartao].giftCard.channelId) != 'undefined') {
        logger.info('channelId:' + aplListaCartaoAtivo[aplIndCartao].giftCard.channelId);
        if (GOVERNO_CHANNELID.indexOf('#' + aplListaCartaoAtivo[aplIndCartao].giftCard.channelId + '#') >= 0) {
          logger.info('GOVERNO_CHANNELID');
          if (((aplListaCartaoAtivo[aplIndCartao].giftCard.channelId) == '666') || ((aplListaCartaoAtivo[aplIndCartao].giftCard.channelId) == 666)) {
            resp = FILA_MINHACASAMELHOR;
          } else if (((aplListaCartaoAtivo[aplIndCartao].giftCard.channelId) == '777') || ((aplListaCartaoAtivo[aplIndCartao].giftCard.channelId) == 777)) {
            resp = FILA_MINHACASAMELHOR;
          } else if (((aplListaCartaoAtivo[aplIndCartao].giftCard.channelId) == '888') || ((aplListaCartaoAtivo[aplIndCartao].giftCard.channelId) == 888)) {
            resp = FILA_MINHACASAMELHOR;
          } else if (((aplListaCartaoAtivo[aplIndCartao].giftCard.channelId) == '1170') || ((aplListaCartaoAtivo[aplIndCartao].giftCard.channelId) == 1170)) {
            resp = FILA_MINHACASAMELHOR;
          } else if (((aplListaCartaoAtivo[aplIndCartao].giftCard.channelId) == '1194') || ((aplListaCartaoAtivo[aplIndCartao].giftCard.channelId) == 1194)) {
            resp = FILA_CAIXAFUTEBOLCLUBE;
          } else if (((aplListaCartaoAtivo[aplIndCartao].giftCard.channelId) == '801') || ((aplListaCartaoAtivo[aplIndCartao].giftCard.channelId) == 801)) {
            resp = FILA_CAIXAFUTEBOLCLUBE;
          } else {
            resp = FILA_AGRO;
          }
          ehValido = true;
        }
      }
    }
    if (aplTotalAtivo > 0) {
      logger.info('GOVERNO_MODALITY aplTotalAtivo:' + aplTotalAtivo);
      logger.info('aplIndCartao:' + aplIndCartao);
      if ((!ehValido) && (typeof(aplListaCartaoAtivo[aplIndCartao].giftCard.modality) != 'undefined')) {
        logger.info('modality:' + aplListaCartaoAtivo[aplIndCartao].giftCard.modality.id);
        if (GOVERNO_MODALITY.indexOf('#' + aplListaCartaoAtivo[aplIndCartao].giftCard.modality.id + '#') >= 0) {
          logger.info('GOVERNO_MODALITY');
          //vale cultura
          resp = FILA_VALECULTURA;
          ehValido = true;
        }
      }
    }
  } else {
    //vale
    //se for vale, o cartão só é válido se não entrar nas condicoes de cartao Projetos Especiais e Governo
    resp = FILA_VALE;
    achou = true;
    if (aplTotalAtivo > 0) {
      if (typeof(aplListaCartaoAtivo[aplIndCartao].giftCard.channelId) != 'undefined') {
        logger.info('channelid:' + aplListaCartaoAtivo[aplIndCartao].giftCard.channelId);
        if (VALE_CHANNELID.indexOf('#' + aplListaCartaoAtivo[aplIndCartao].giftCard.channelId + '#') >= 0) {
          if (aplListaCartaoAtivo[aplIndCartao].giftCard.channelId == '3441') {
            //cartao presente caixa
            resp = FILA_CARTAOPRESENTECAIXA;
          } else {
            //99 taxi
            resp = FILA_99TAXI;
          }
          achou = true;
        }
      }
    }
    if (aplTotalAtivo > 0) {
      if ((aplListaCartaoAtivo[aplIndCartao].giftCard.channelId == 4740) || (aplListaCartaoAtivo[aplIndCartao].giftCard.channelId == 6474)) {
        resp = FILA_99TAXI;
        logger.info('99TAXI');
        achou = true;
      }
    }
    logger.info('salesType' + aplListaCartaoAtivo[aplIndCartao].giftCard.salesType);
    if (aplTotalAtivo > 0) {
      if ((!achou) && (typeof(aplListaCartaoAtivo[aplIndCartao].giftCard.salesType) != 'undefined')) {
        if (VALE_TIPOVENDA.indexOf('#' + aplListaCartaoAtivo[aplIndCartao].giftCard.salesType + '#') >= 0) {
          //walmart
          resp = FILA_WALMART;
        } else {
          //so preenche para nao parecer que faltou alguma coisa, porque em cima ja preencheu o valor correto e a
          //variavel achou nao é mais necessaria
          achou = false;
        }
      }
    }
  }
  logger.info('resp:' + resp);
  return resp;
}
