// FUNCAO QUE TRATA A EXPANSAO DE VALOR PARA MOVIMENTACOES
// SUBSTITUINDO MENO POR DEBITO OU ACRESCENTANDO CREDITO NA FRASE
//
// BY: FELIPE JACOBUCCI (FEITO EM BAURU - SP) 30/08/2019

function reExpandeValor(frase){
  var fraseRetorno = '';

  if(frase.indexOf("MENOS;") >= 0){
    fraseRetorno = frase.replace("MENOS;","SILENCIO;");
    fraseRetorno = ";DEBITO;SILENCIO;SILENCIO;" + fraseRetorno ;
  }
  else{
    fraseRetorno = ";CREDITO;SILENCIO;SILENCIO;" + frase;
  }
  return fraseRetorno;
}

